import React from "react";
import {Button, Text, TextInput, View,StatusBar, StyleSheet, FlatList, SafeAreaView } from "react-native";



const MoodBtns = ({ changeMood }) => {

  return (
    <View>
      <Button title='Encourage Laziness' onPress={() => changeMood("lazy")} />

      <Button title='test' onPress={() => console.log("email and password recieved")} />


      <Button title='Fill with Determination' onPress={() => changeMood("determined")} />
    </View>
  );
}

export default MoodBtns;
